import React from "react";

const Feature = (props) => {
    return <tr>
        <td class="tooltip">
            {props.name}
            <span class="svg-icons">
                <svg viewBox="0 0 448 512">
                </svg>
            </span>
            <div class="tooltiptext">
                {props.description}
            </div>
        </td>
        {
            props.plans.map((pl) => {
                const availabilityClass = pl.available ? "has" : "hasnot"
                return <td><span class={availabilityClass}></span></td>
            })
        }
    </tr>
}

export default Feature;
